window.bookSummaryJSON = "<p>Power is never given, only taken</p> <p>Tobias Richter, the fearsome VP of Security of the TechCorps is dead. The puppet master is gone and the organization is scrambling to maintain control by ruthlessly limiting Atlanta's access to resources, hoping to quell rebellion. Our band of mercenary librarians have decided that the time for revolution has come.</p> <p>Maya uses her wealth of secrets to weaken the TechCorps from within. Dani strikes from the shadows, picking off the chain of command one ambush at a time. And Nina is organizing their community—not just to survive, but to fight back. When Maya needs to make contact with a sympathetic insider, Dani and Rafe are the only ones with the skill-set and experience to infiltrate the highest levels of the TechCorps. They'll go deep undercover in the decadent, luxury-soaked penthouses on the Hill.</p> <p>Bringing Dani face-to-face with the man who turned her into a killer. And forcing Rafe to decide how far he'll go to protect both of his families-the one he was born to, and the one he made for himself.</p> <p>Victory will break the back of Power. Failure will destroy Atlanta.</p>"; 
